import { Container, Stack, Typography } from "@mui/material";

export default function KYsheetDetails() {
  return (
    <Container maxWidth="95%">
      <Stack spacing={2}>
        <Typography>1</Typography>
        <Typography>KY Sheet Details</Typography>
      </Stack>
    </Container>
  );
}
